USE myDB;

DROP TABLE IF EXISTS tbl_iolist;
CREATE TABLE IF NOT EXISTS tbl_iolist(
	IO_SEQ BIGINT PRIMARY KEY,
	IO_DATE VARCHAR(10),
	IO_INOUT VARCHAR(2),
	IO_QTY INT,
	IO_PRICE INT,
	IO_AMT INT,
	IO_PCODE CHAR(5),
	IO_BCODE CHAR(4)
);

